import React,{ useState } from "react";
import { GoogleMap, InfoWindow, LoadScript, Marker, InfoBox, Polyline} from '@react-google-maps/api';

export default function InfoMap(props){
    const [infomapdata,setInfomapdata] = useState(false);
    const [infopopdata,setInfopopdata] = useState(false);
    const [infotrunkdata,setInfotrunkdata] = useState(false);
    const [infoline1,setInfoline1] = useState(false);
    const [infoline2,setInfoline2] = useState(false);
    const [infoline3,setInfoline3] = useState(false);
    const [infoline4,setInfoline4] = useState(false);
    const [infoline5,setInfoline5] = useState(false);
    const [infoline6,setInfoline6] = useState(false);
    const [infoline7,setInfoline7] = useState(false);
    const [infoline8,setInfoline8] = useState(false);
    const [infoline9,setInfoline9] = useState(false);
    const [infoline10,setInfoline10] = useState(false);
    const [infoline11,setInfoline11] = useState(false);
    const [infoline12,setInfoline12] = useState(false);
    const [infoline13,setInfoline13] = useState(false);
    const [infoline14,setInfoline14] = useState(false);
    const [infoline15,setInfoline15] = useState(false);
    const [infoline16,setInfoline16] = useState(false);
    const [infoline17,setInfoline17] = useState(false);
    const [infoline18,setInfoline18] = useState(false);
    const [btbt,setBtbt] = useState(false);

    
    /* Data 추출 */
    const line1 = props.line1.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line2 = props.line2.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line3 = props.line3.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line4 = props.line4.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line5 = props.line5.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line6 = props.line6.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line7 = props.line7.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line8 = props.line8.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line9 = props.line9.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line10 = props.line10.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line11 = props.line11.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line12 = props.line12.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line13 = props.line13.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line14 = props.line14.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line15 = props.line15.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line16 = props.line16.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line17 = props.line17.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });
    const line18 = props.line18.map((value)=>{
        return {lat : value.lat,lng : value.lng};
    });

    /* google map stlye */
    const style = {
        width : '1200px',
        height : '700px',
        margin : '20px',
    };

    /* google map 첫 화면 */
    const center = {
        lat : -4.39636,
        lng : 15.31693
    };

    /* InfoWindow style */
    const canvas = {
        background : '#fff',
        padding: 10
    };

    /* infoBox options */
    //const options = { closeBoxURL: '', enableEventPropagation: true };
    
    /* Polygon options */
    const options300 = {
        strokeColor:'blue',
        strokeOpacity: 0.75,
        strokeWeight: 6,
    };
    const options200 = {
        strokeColor:'green',
        strokeOpacity: 0.75,
        strokeWeight: 4,
    };
    const options100 = {
        strokeColor:'orange',
        strokeOpacity: 0.75,
        strokeWeight: 2,
    };
    const onClickEven = (value)=>{
        return (
        <InfoWindow position={{lat : value.lat+0.005100 , lng : value.lng+0.000010}}>
            <div className="infowindow">
                <p className="infoitem info_title">NetworkNode Name : {value.nw_node}</p>
                <p className="infoitem">lat : {value.lat}</p>
                <p className="infoitem">lng : {value.lng}</p>
            </div>
        </InfoWindow>
        );
    }

    return (
        <>
            <div className="map">
            <div className="btnlist">
                {/* <button className="btntt" onClick={()=>{setInfowWindowpolyline3(!infowWindowpolyline3)}}>Bandwidth 300</button>
                <button className="btntt" onClick={()=>{setInfowWindowpolyline2(!infowWindowpolyline2)}}>Bandwidth 200</button>
                <button className="btntt" onClick={()=>{setInfowWindowpolyline1(!infowWindowpolyline1)}}>Bandwidth 100</button> */}
            </div>
            <div className="container_map">
            <LoadScript googleMapsApiKey="AIzaSyDevvetng60XedeOqk-qW9TF-XBNQsyxdE">
                <GoogleMap
                    mapContainerStyle={style}
                    center={center}
                    zoom={12}
                    className="googlemap"
                >
                    {
                        props.mapData.map(value=>{
                            console.log(value);
                            if(value.num ===1){
                                return (
                                    <>
                                        <Marker 
                                            position={value} 
                                            onClick={()=>{setInfoline1(!infoline1)}}
                                        />
                                        {infoline1 && (
                                            <InfoWindow position={{lat : value.lat+0.005100 , lng : value.lng+0.000010}}>
                                            <div className="infowindow">
                                                <p className="infoitem info_title">NetworkNode Name : {value.nw_node}</p>
                                                <p className="infoitem">lat : {value.lat}</p>
                                                <p className="infoitem">lng : {value.lng}</p>
                                            </div>
                                        </InfoWindow>)}
                                    </>
                                );
                            }
                            else if(value.num === 2){
                                console.log(value);
                                return (
                                    <>
                                        <Marker 
                                            position={value} 
                                            onClick={()=>{setInfoline2(!infoline2)}}
                                        />
                                        {infoline2 && (
                                            <InfoWindow position={{lat : value.lat+0.005100 , lng : value.lng+0.000010}}>
                                            <div className="infowindow">
                                                <p className="infoitem info_title">NetworkNode Name : {value.nw_node}</p>
                                                <p className="infoitem">lat : {value.lat}</p>
                                                <p className="infoitem">lng : {value.lng}</p>
                                            </div>
                                        </InfoWindow>)}
                                    </>
                                );
                            }
                            else if(value.num === 3){
                                console.log(value);
                                return (
                                    <>
                                        <Marker 
                                            position={value} 
                                            onClick={()=>{setInfoline3(!infoline3)}}
                                        />
                                        {infoline3 && (
                                            <InfoWindow position={{lat : value.lat+0.005100 , lng : value.lng+0.000010}}>
                                            <div className="infowindow">
                                                <p className="infoitem info_title">NetworkNode Name : {value.nw_node}</p>
                                                <p className="infoitem">lat : {value.lat}</p>
                                                <p className="infoitem">lng : {value.lng}</p>
                                            </div>
                                        </InfoWindow>)}
                                    </>
                                );
                            }
                        })
                    }
                    {/* {
                        props.mapData.map((value)=>{
                            return (
                                <>
                                    <Marker 
                                        position={{lat : value.lat , lng : value.lng}}
                                        icon={
                                            {
                                                url : '11.png',
                                                scaledSize : new google.maps.Size(15,20),
                                            }
                                        }
                                        onMouseOver={()=>{setInfomapdata(!infomapdata)}}
                                    />
                                    {infomapdata && (
                                        <InfoWindow position={{lat : value.lat+0.005100 , lng : value.lng+0.000010}}>
                                            <div className="infowindow">
                                                <p className="infoitem info_title">NetworkNode Name : {value.nw_node}</p>
                                                <p className="infoitem">lat : {value.lat}</p>
                                                <p className="infoitem">lng : {value.lng}</p>
                                            </div>
                                        </InfoWindow>
                                    )}
                                </>
                            );
                        })
                    } */}
                    {
                        props.popData.map((value)=>{
                            return (
                                <>
                                    <Marker 
                                        position={{lat : value.lat , lng : value.lng}}
                                        icon={
                                            {
                                                url : '22.png',
                                                scaledSize : new google.maps.Size(25,30),
                                            }
                                        }
                                        onMouseOver={()=>{setInfopopdata(!infopopdata)}}
                                    />
                                    {infopopdata && (
                                        <InfoWindow position={{lat : value.lat+0.005100 , lng : value.lng+0.000010}}>
                                            <div className="infowindow">
                                                <p className="infoitem info_title">NetworkNode Name : {value.p_node}</p>
                                                <p className="infoitem">lat : {value.lat}</p>
                                                <p className="infoitem">lng : {value.lng}</p>
                                            </div>
                                        </InfoWindow>
                                    )}
                                </>
                            );
                        })
                    }
                    {
                        props.trunk.map((value)=>{
                            return (
                                <>
